CHAPITRE  42 
OUVRAGES EN CUIR; ARTICLES DE BOURRELLERIE  
OU DE SELLERIE  ; ARTICLES  DE VOYAGE,  SACS  A MAIN  
ET CONTENANTS  SIMILAIRES  ; OUVRAGES  EN BOYAUX  
Notes . 
1.- Au sens du présent Chapitre, le cuir naturel comprend  également les cuirs et peaux chamoisés (y  
compris  le chamois  combiné),  les cuirs  et peaux  vernis  ou plaqués  et les cuirs  et peaux  métalisés.  
2.- Le présent  Chapitre ne comprend  pas :
a)les catguts  stériles  et ligatures  stériles  similaires  pour sutures  chirurgicales  (n° 30.06);
b)les vêtements et accessoires du vêtement (autres que les gants, mitaines et moufles) en cuir,
fourrés  intérieurement de pelleteries  naturelles  ou factices,  ainsi que les vêtements  et
accessoires du vêtement en cuir comportant des parties extérieures en pelleteries naturelles ou
factices, lorsque ces parties excèdent le rôle de simples garnitures (n°s 43.03 ou 43.04, selon le
cas) ;
c)les articles  confectionnés  en filet du n° 56.08;
d)les articles  du Chapitre  64;
e)les coiffures  et partie s de coiffures  du Chapitre  65;
f)les fouets,  cravaches  et autres  articles  du n° 66.02;
g)les boutons  de manchettes, bracelets  et autres  articles  de bijouterie  de fantaisie  (n° 71.17);
h)les accessoires  et garnitures  de sellerie  ou de bourrellerie  (mors,  étriers,  boucles,

étriers,  boucles,  par exemple)
présentés  isolément  (Section  XV, généralement);
ij) les cordes  harmoniques,  les peaux  de tambours  ou d'instruments  similaires,  ainsi que les autres  
parties  d'instruments  de musique  (n° 92.09)  ; 
k)les articles  du Chapitre  94 (meubles,  luminaires  et appareils  d'éclairage, par exemple)  ;
l)les articles  du Chapitre  95 (jouets,  jeux,  engins  sportifs,  par exemple)  ;
m) les boutons,  les boutons -pression,  les formes  pour boutons  et autres  parties  de boutons  ou de
boutons -pression,  les ébauches  de boutons,  du n° 96.06.
3.- A) Outre les  dispositions  de la Note  2 ci-dessus, le n°  42.02 ne  comprend  pas : 
a)les sacs  faits de feuilles  en matière  plastique,  même  imprimées,  avec  poignées,  non conçus  pour
un usage  prolongé  (n° 39.23) ;
b)les articles  en matières  à tresser  (n° 46.02);
B) Les ouvrages repris dans les n°s 42.02 et 42.03 comportant des parties en métaux précieux, en
plaqués ou doublés de métaux précieux, en perles fines ou de culture, en pierres gemmes ou en
pierres synthétiques ou reconstituées restent compris dans ces positions mêmes si ces parties
excèdent le rôle de simples accessoires ou garnitures de minime importance, à condition que ces
parties ne confèrent pas aux ouvrages leur caractère essentiel.
